 @andersonaraujoluz8978 Exatamente isso , e gente falando que é o diniz sabe de nada inocente.kkk
Que treinador que iria preferir um atacante que fez 1 gol na premiere league na temporada (gabriel jesus), ou tiquinho que fez mais de vinte gols.
Óbvio, que tem dedo de empresários e CBF.

Sou Botafoguense, minhas considerações dessa partida e do futuro dela:
a) acho que o Tiquinho fez falta, mas estava sem VAR para analisar devido à queda de energia no início da partida;
b) acho que o Pablo estava adiantando, mas novamente estava sem VAR para analisar por causa da falta de luz.
Foi correto em remarcar a partida, mas NÃO foi correto para o dia seguinte, pois isso prejudica o Botafogo triplamente:
1) o Botafogo jogará a partida com os portões fechados, sendo que ele estava jogando com casa cheia, e o regulamento da CBF prevê que jogos remarcados a mesma torcida poderá entrar no estádio com o ingresso em mãos;
2) a partida contra o Fortaleza foi adiada, e o Botafogo jogaria contra eles com a equipe reserva, visto que eles irão jogar a final da Sul-Americana no final de semana. Isso não acontecerá mais com essa partida adiada. Além disso, quem já comprou ingresso para esse jogo, e já pagou passagem e hospedagem também se ferrou;
3) a partida contra o Fortaleza será jogada numa Data FIFA, ou seja, o Botafogo perderá dois de seus melhores jogadores (Perri e Adryelson) por estarem servindo à Seleção Brasileira.
Em resumo: o Botafogo não pode de forma alguma aceitar que isso ocorra e que seja prejudicado por causa de terceiros. Por que terceiros? Porque esta queda de luz foi por culpa da Light. E por que foi culpa da Light? Porque o bairro de Engenho de Dentro inteiro ficou sem luz. A menos que a Light queira dizer que o Botafogo é responsável por fornecer a luz para o bairro INTEIRO, a culpa é única e exclusivamente dela.

 @GabrielSoares-ve8kd  Estou falando do presente,seu doente.
Se fosse bom...não estaria no futebol brasileiro.
Só volta para o Brasil...quando não tem valor lá fora,todo mundo sabe disso
